import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Start from "./Start";
import Pomodoro from "./Pomodoro";
import Todo from "./Todo";
import Topbar from "./Topbar";
import { useState } from "react";

function Main() {
  const [todos, setTodos] = useState([]);
  const [formTodo, setFormTodo] = useState("");
  const [completedTodos, setCompletedTodo] = useState([]);
  const [stopwatch, setStopwatch] = useState(1);
  const [stopWatchState, setStopwatchState] = useState(false);
  const [status, setStatus] = useState(false);

  return (
    <Router>
      <div className="App">
        <Topbar></Topbar>
        <div className="contentWrapper">
          <Routes>
            <Route path="/" element={<Start />} />
            <Route
              path="/todo"
              element={
                <Todo
                  todos={todos}
                  formTodo={formTodo}
                  setTodos={setTodos}
                  setFormTodo={setFormTodo}
                  completedTodos={completedTodos}
                  setCompletedTodo={setCompletedTodo}
                />
              }
            />
            <Route
              path="/pomodoro"
              element={
                <Pomodoro stopwatch="stopwatch" setStopwatch="setStopwatch" />
              }
            />
          </Routes>
        </div>
      </div>
    </Router>
  );
}

export default Main;
